import styled from "styled-components";


const Container = styled.div`
    position: absolute;
    width: 1008px;
    height: 64px;
    left: 272px;
    top: 64px;

    background: red;
`;

const Periodo = styled.span`
    /* Junho 2022 */

    position: absolute;
    width: 86px;
    height: 19px;
    left: 43px;
    top: 24px;

    font-family: 'Roboto';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 19px;

    /* identical to box height */

    /* Color/Primary/Branding */
    color: #5B1F53;
`;

const VetorContainer = styled.div`
    position: absolute;
    width: 24px;
    height: 24px;
    left: 137px;
    top: 46px;
`;




export {Container, Periodo, VetorContainer};
